import React from 'react'
import Badge from '@mui/material/Badge';
import Stack from '@mui/material/Stack';
import CheckCircleOutlineIcon from '@mui/icons-material/CheckCircleOutline';
import { Typography } from '@mui/material';
import StarOutlineIcon from '@mui/icons-material/StarOutline';
const BodyLeft = () => {
  return (
    <div>
     <Stack spacing={2} direction="row" sx={{backgroundColor:"red",width:"350px" ,height:"60px",marginLeft:"240px" ,paddingTop:"11px"}}>
      <Badge  >
        <CheckCircleOutlineIcon sx={{marginRight:"6px",marginLeft:"6px"}}></CheckCircleOutlineIcon>
        <Typography sx={{marginRight:"6px"}}>Inbox</Typography>
<StarOutlineIcon ></StarOutlineIcon>
      </Badge>
      <Badge >
        

      </Badge>
    </Stack>
    </div>
  )
}

export default BodyLeft
